import React from "react";
import { useState } from "react";
import {getAllUser} from "../axios/userAxios"

const ProfileUser = (props) => {
    const {users} = props
    // const [users, setUsers] = useState([])
    // const getUserHandler = () => {
    //     getAllUser((result) => setUsers(result))
    // }
    return (
            <><div>
            <table className='table table-hover table-bordered'>
                <thead>
                    <tr>
                        <th>Id</th>
                        <th>Name</th>
                        <th>Email</th>
                        <th>Photo</th>
                        <th>Status</th>
                    </tr>
                </thead>
                <tbody>
                    {users.map((user) => {
                        const { id, username, email, password, photo, status } = user;
                        return (
                            <tr key={id}>
                                <td>{id}</td>
                                <td>{username}</td>
                                <td>{email}</td>
                                <td>
                                    <image href={photo}></image>
                                </td>
                                <td>{status}</td>
                            </tr>

                        );
                    })}
                </tbody>

            </table>
        </div>
        {/* <div>
            <button
                onClick={() => getUserHandler()}></button>
        </div> */}
        </>
    )
}

export default ProfileUser
